// IntroPage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './IntroPage.css'; // Add custom styles
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap styles

const IntroPage = () => {
  const navigate = useNavigate();

  const handleStartClick = () => {
    navigate('/app'); // Redirect to App.js
  };

  return (
    <div className="intro-container">
      <header className="header">
        <h1 className="logo">MindMesh</h1>
      </header>
      <div className="content">
        <h1 className="title">MindMesh</h1>
        <p className="description">Summarizer and Mind Map Generator</p>
        <div className="image-container">
          <img src="D:\import-file-app-new\import-file-app\src\images\ocr.jpg" alt="Description 1" className="intro-image" />
          <img src="D:\import-file-app-new\import-file-app\src\images\pdf.png" alt="Description 2" className="intro-image" />
          <img src="D:\import-file-app-new\import-file-app\src\images\txt.png" alt="Description 3" className="intro-image" />
          <img src="/path/to/image4.jpg" alt="Description 4" className="intro-image" />
        </div>
        <button
          type="button"
          className="btn btn-primary btn-lg"
          onClick={handleStartClick}
        >
          Click to Start
        </button>
      </div>
    </div>
  );
};

export default IntroPage;
